import React, { useEffect, useState } from 'react';
import './App.css';
import NavBar from './NavBar';
import GraduateAcc from './accounts/GraduateAcc';
import SavingAcc from './accounts/SavingsAcc';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/data')
      .then(response => response.json())
      .then(data => setData(data))
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  return (
    <BrowserRouter>
      <div className='App'>
        <h1>Account Name</h1>
        <div className='page-body'>
          <NavBar />
          <Routes>
            <Route
              path='/'
              element={
                <div>
                  <GraduateAcc />
                  <SavingAcc />
                  <div>
                    <h2>Data from PostgreSQL:</h2>
                    <ul>
                      {data.map((item, index) => (
                        <li key={index}>{item.column_name}</li>
                      ))}
                    </ul>
                  </div>
                </div>
              }
            />
            <Route path='/graduate' element={<GraduateAcc />} />
            <Route path='/savings' element={<SavingAcc />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
